import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <nav className="navbar nacbar-expand-lg bg-transparent sticky-top">
          <a className="navbar-brand" href="#">VisComp</a>
        </nav>
      </div>
    </div>
  );
}

export default App;
